  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115284 includes biological,
  chemical, discrete sample, physical and profile data collected from RYOFU MARU in
  the North Pacific Ocean and Philippine Sea from 1999-04-19 to 1999-05-26 and retrieved
  during cruise PACIFICA_49RY19990419 and RY99-04. These data include ALKALINITY,
  AMMONIUM, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), CHLOROPHYLL
  A, DELTA CARBON-13, DISSOLVED INORGANIC CARBON, DISSOLVED ORGANIC CARBON, DISSOLVED
  OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRATE + NITRITE CONTENT (CONCENTRATION),
  NITRITE, PHAEOPHYTIN, PHOSPHATE, Potential temperature (theta), SALINITY, SIGMA-THETA,
  SILICATE, TOTAL PHOSPHORUS, WATER TEMPERATURE and pH. The instruments used to collect
  these data include CTD and bottle. These data were collected by Kazuhiro Nemoto
  of Japan Meteorological Agency and Masao Ishii of Meteorological Research Institute;
  Geochemical Research Department as part of the PACIFICA_49RY19990419 data set.nnPACIFICA
  (PACIFic ocean Interior CArbon) was an international collaborative project for the
  data synthesis of ocean interior carbon and its related parameters in the Pacific
  Ocean. The North Pacific Marine Science Organization (PICES), Section of Carbon
  and Climate (S-CC) supported the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
